-- ----------------------------
-- Triggers structure for table product_stock
-- ----------------------------
DROP TRIGGER IF EXISTS `insert_product_stock`;
delimiter ;;
CREATE TRIGGER `insert_product_stock` AFTER INSERT ON `product_stock` FOR EACH ROW BEGIN
DECLARE stockCumstom INT;
    IF NEW.type = 'stok_masuk' THEN
        BEGIN
            UPDATE product SET stock = stock + NEW.total 
            WHERE idproduct = NEW.idproduct;
        END;
    END IF;
    IF NEW.type = 'stok_keluar' THEN
        BEGIN
            SELECT stock - NEW.total INTO stockCumstom FROM product 
            WHERE idproduct = NEW.idproduct;
            IF stockCumstom < 1 THEN
                BEGIN
                    SET stockCumstom = 0 ;
                END;
            END IF;
            UPDATE product SET stock = stockCumstom 
            WHERE idproduct = NEW.idproduct;
        END;
    END IF;
    
END
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table product_stock
-- ----------------------------
DROP TRIGGER IF EXISTS `update_product_stock`;
delimiter ;;
CREATE TRIGGER `update_product_stock` AFTER UPDATE ON `product_stock` FOR EACH ROW BEGIN
    DECLARE stockCumstom INT;
    IF OLD.type = 'stok_masuk' THEN
        BEGIN
            UPDATE product SET stock = stock - OLD.total WHERE idproduct = OLD.idproduct; 
        END;
    END IF;
    IF OLD.type = 'stok_keluar' THEN
        BEGIN
            UPDATE product SET stock = stock + OLD.total WHERE idproduct = OLD.idproduct;
        END;
    END IF;
    IF NEW.type = 'stok_masuk' THEN
        BEGIN
            UPDATE product SET stock = stock + NEW.total 
            WHERE idproduct = NEW.idproduct;
        END;
    END IF;
    IF NEW.type = 'stok_keluar' THEN
        BEGIN
            SELECT stock - NEW.total INTO stockCumstom FROM product 
            WHERE idproduct = NEW.idproduct;
            IF stockCumstom < 1 THEN
                BEGIN
                    SET stockCumstom = 0 ;
                END;
            END IF;
            UPDATE product SET stock = stockCumstom 
            WHERE idproduct = NEW.idproduct;
        END;
    END IF;
END
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table product_stock
-- ----------------------------
DROP TRIGGER IF EXISTS `delete_product_stock`;
delimiter ;;
CREATE TRIGGER `delete_product_stock` AFTER DELETE ON `product_stock` FOR EACH ROW BEGIN
	IF OLD.type = 'stok_masuk' THEN
    	BEGIN
        	UPDATE product set stock = stock - OLD.total 
  			WHERE idproduct = OLD.idproduct;
        END;
    END IF;
    IF OLD.type = 'stok_keluar' THEN

    	BEGIN
        	UPDATE product set stock = stock + OLD.total 
  			WHERE idproduct = OLD.idproduct;
        END;
    END IF;
    
END
;;
delimiter ;

